import React from 'react';
import Logo from '../../assets/img/logo.png';
import './menu.css';

function Menu(){
    return(
        <nav className="Menu">
            <a>
                <img className="logo" src={Logo} alt="Logo Flix" />
            </a>
        </nav>
    )
    
}

export default Menu;
